import Dropdown from "../../ui/Dropdown";
import { FilterRowContainer } from "../FiltersBar/FiltersBar.styles";

type Props = {
  index: number;
  values: FilterValues;
  removeFilter(): void;
};

const FilterRow = ({ values }: Props) => {
  return (
    <FilterRowContainer>
      <Dropdown
        value={values.key}
        options={[]}
        variant={"rectangle"}
        noArrow
        disabled
      />
    </FilterRowContainer>
  );
};

export default FilterRow;
